open and flowing The most amazing Bertha I have ever heard. Then listenning to Jerry sing Mississippi Half Step struck me initially, much as hearing a teisho/talk of the now almost 100 year old zen master, Sasaki aka Kyozan Joshu, Roshi. 

Minor sound problems as the tape goes on, but what the heck . . . very powerful Black Throated Wind. 

{Interesting moment in Let it Grow when Bob forgets his lyrics, and then sort of be-bops his way through the line.}
